import React from 'react';
import Nav from 'react-bootstrap/Nav';
import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';
import NavDropdown from 'react-bootstrap/NavDropdown';



class Nav1 extends React.Component {
	render(){
		console.log(Nav);
		return(
			<Nav className="navbar navbar-expand-lg navbar-dark ftco_navbar bg-dark ftco-navbar-light">
				<Container>
					<Nav.Item >
						<Nav.Link className="navbar-brand">Komerz.io</Nav.Link>
					</Nav.Item>
					<Button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#ftco-nav" aria-controls="ftco-nav" aria-expanded="false" aria-label="Toggle navigation">
						<span className="oi oi-menu"></span>
    					Menu	
					</Button>
					<div className="collapse navbar-collapse">
						<ul className = "navbar-nav ml-auto">
							<li className="nav-item cta">
								<Nav.Link className="nav-link icon d-flex align-items-center">
									<i className="ion-ios-cloud-download mr-2"></i> 
									Download
								</Nav.Link>
							</li>
							<li className="nav-item cta">
								<Nav.Link className="nav-link icon d-flex align-items-center">
									<i className="ion-ios-cloud-download mr-2"></i> 
									Download
								</Nav.Link>
							</li>

						</ul>
					</div>
				</Container>
			</Nav>
		)

	}
}
export default Nav1;
